return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2023-08-07 07:34:01+0000','plural-forms'=>'nplurals=3; plural=(n % 10 == 1 && n % 100 != 11) ? 0 : ((n % 10 >= 2 && n % 10 <= 4 && (n % 100 < 12 || n % 100 > 14)) ? 1 : 2);','project-id-version'=>'Themes - Bold Photography','language'=>'ru','messages'=>['Bold Photography'=>'Bold Photography','Bold Photography is a free, dark multipurpose photography WordPress theme that comes with a sleek design and awesome functionality to unleash your photography creativity. It has been specially crafted to showcase another level of photography websites with its dark and bold look. However, you can use it for any kind of website and deliver a shady look. Bold Photography includes both the looks and astounding functionality to further intensify the website. The new dark multipurpose photography theme, Bold Photography is power-packed with crucial features like Portfolio, Services, Testimonials, and many more. All of these features have been carved keeping multipurpose websites in mind but also prioritizing photography websites. Bold Photography is the ultimate stop if you want a dark and bold website for your creativity. Download Bold Photography today and flaunt the darker side of you with grace. For advanced features, upgrade to premium version. For more information, check out Theme Instructions at https://catchthemes.com/themes/bold-photography-pro/#theme-instructions and Demo at https://catchthemes.com/demo/bold-photography/.'=>'Bold Photography - это бесплатная темная многоцелевая тема WordPress для фотографий, которая отличается элегантным дизайном и потрясающей функциональностью, позволяющей раскрыть творческий потенциал фотографа. Она была специально разработана для демонстрации другого уровня веб-сайтов, посвященных фотографии, благодаря своему темному и смелому виду. Тем не менее, ее можно использовать для любого типа веб-сайта и придать ему мрачный вид. Bold Photography включает в себя как внешний вид, так и поразительную функциональность для дальнейшего совершенствования сайта. Новая темная многоцелевая тема для фотографий Bold Photography оснащена такими важными функциями, как портфолио, услуги, отзывы и многими другими. Все эти функции были разработаны с учетом особенностей многоцелевых сайтов, а также с учетом приоритета веб-сайтов, посвященных фотографии. Bold Photography - это конечная остановка, если вам нужен темный и смелый сайт для вашего творчества. Загрузите Bold Photography сегодня и покажите свою темную сторону с изяществом. Для получения дополнительных возможностей перейдите на премиум-версию. Для получения дополнительной информации ознакомьтесь с инструкциями к теме на сайте https://catchthemes.com/themes/bold-photography-pro/#theme-instructions и демонстрацией на сайте https://catchthemes.com/demo/bold-photography/.','list item separator, '=>', ','This plugin was activated successfully:'=>'Этот плагин успешно активирован:','If you add video, it will only show up on Homepage/FrontPage. Other Pages will use Header/Post/Page Image depending on your selection of option. Header Image will be used as a fallback while the video loads '=>'Если Вы добавите видео, оно будет отображаться только на заглавной странице. Другие страницы будут использовать изображение заголовка / записи / страницы в зависимости от вашего выбора. Изображение заголовка будет использоваться в качестве запасного варианта, пока загружается видео ','Homepage / Frontpage'=>'Главная страница','Entire Site'=>'Весь сайт','Disabled'=>'Отключено','Header Media Overlay'=>'Наложение медиа заголовка','Header Media Title'=>'Название медиафайла заголовка','Site Header Text'=>'Текст заголовка сайта','Header Media Url'=>'URL медиафайла заголовка','Header Media Url Text'=>'Текст URL медиафайла заголовка','Open Link in New Window/Tab'=>'Открыть ссылку в новом окне/вкладке','Default(Older Posts/Newer Posts)'=>'По умолчанию (предыдущие записи/следующие записи)','Numeric'=>'Числовой','-- Select --'=>